import React from "react";
import propTypes from "prop-types";
import { Menu, MenuDiv } from "./hidden-menu.styles";

const HiddenMenu = ({ isClicked, handleBlur }) => (
  <MenuDiv isClicked={isClicked} onBlur={handleBlur}>
    <Menu>
      <p>hello</p>
      <p>hello</p>
    </Menu>
    <Menu>
      <p>hello</p>
      <p>hello</p>
    </Menu>
  </MenuDiv>
);
HiddenMenu.propTypes = {
  isClicked: propTypes.bool.isRequired,
  handleBlur: propTypes.bool.isRequired,
};

export default HiddenMenu;
